- The `onlyOwner` modifier is used to restrict access to the `transferOwnership` function.
- The `transferOwnership` function checks that the new owner is not the zero address and updates the owner.
- The `OwnershipTransferred` event is emitted to log the change of ownership.
- The constructor sets the initial owner to the address that deploys the contract.

